import React from 'react';
import {NavLink} from "react-router-dom";
import s from './Navbar.module.css'
const Navbar = () => {
    return(
        <div className={s.main}>
            <nav>
                <div className={s.main_nav}>
                    <NavLink className={s.item} activeClassName={s.active} to="/profile">Profile</NavLink>
                    <NavLink className={s.item} to="/dialogs">Messages</NavLink>
                    <NavLink className={s.item} to="#">News</NavLink>
                    <NavLink className={s.item} to="#">Music</NavLink>
                    <NavLink className={s.item} to="#">Setting</NavLink>
                </div>
            </nav>
        </div>
    );
}
export default Navbar;
